import styled from "styled-components"

export const Container = styled.View`
  background: blue;     
`;

export const Title = styled.Text`
    position: absolute;
    width: 123px;
    height: 24px;
    left: 30px;
    top: 105px;
    font-family: Poppins;
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    color: #1D1617;
`;

export const Cabecalho = styled.div`
    background: red;
`;
